There are numerous artists with this name, including: 
1) Lone is British electronic music producer Matt Cutler; 
2) Lone is Dutch rock duo Ferdinand Bakker and Michel van Dijk; 
3) Lone is a Spanish hip hop artist; 
4) Lone was a French hip-hop artist; 
5) Lone was a German punk band. 

