Struka is a rapper from Rakovica, Belgrade. He started rapping at the end of the year 2000. After a year and a half he was signed by the Serbian rap label, Bassivity. He has so far released two solo albums: 
"Ipak se obrće" (English: "Anyhow, It Revolves", named by the famous TV show in Serbia) (2004);
"Muzika iz podruma" (english: "Music from the Basement") (2007). In the year 2007, he founded his own label, "Grupna Terapija" (Group Therapy), on <a href="https://www.last.fm/music/Struka">Read more on Last.fm</a>

There are multiple artists named Necro;

1) Ron Raphael Braunstein (born June 7, 1976), better known by his stage-name Necro, is an American rapper from Brooklyn. He is the owner of Psycho+Logical-Records founded November 1999. He is the younger brother of rapper Ill Bill.

Necro was born in Brooklyn, New York and grew up in the Glenwood Houses, where he lived for eight years from about 6 years old to age 14, when he moved to Canarsie. Born into a Jewish family, he is the son of Israeli expatriates, with ancestry from Israel and Romania. <a href="https://www.last.fm/music/Necro">Read more on Last.fm</a>

There are at least two artists with the name The Prototypes;

1) The Prototypes is a British drum and bass project by producer Nick White. Until May 2023, it was a duo alongside fellow producer Chris Garvey. 

Founded in Brighton, England, in the late 2000s, by 2010 they had released their first singles on labels such as Formation Records and Viper Recordings, and from 2011 to 2013 were signed to Shogun Audio. They have released a number of EPs, and have received radio and live PA support from DJs such as Matrix & Futurebound. <a href="https://www.last.fm/music/The+Prototypes">Read more on Last.fm</a>
